import React from 'react';
import './D3section1.css';

function D3section1() {
    return (
        <div className="d3section1">
            <div className="d3s1d1">
                <img src="data:image/jpeg;base64," alt="1"/>
            </div>
            <div className="d3s1d2">
                <img src="data:image/jpeg;base64," alt="1"/>
            </div>
            <div className="d3s1d3">
                <img src="data:image/jpeg;base64," alt="1"/>
            </div>
            <div className="d3s1d4">
                <img src="data:image/jpeg;base64," alt="1"/>
            </div>
            <div className>
                <img src="data:image/jpeg;base64," alt="1"/>
            </div>
        </div>
    )
}

export default D3section1
